module.exports = function cleanUrl(url) {
    if(url){
        url=url.split(',')
        if(url.length > 2){
            url=url[1].split(' ')
            if(url.length >2){
                return url[1]
            }else{
                return url[0]
            }
        }else{
            url=url[0].split(' ')
            return url
        }
        
    }
    
}
